import React from 'react';
import { Container, Row, Col, Image, Button } from 'react-bootstrap';
import MobileTopArtists from './MobileTopArtists';
import MobileProfileRecentActivity from './MobileProfileRecentActivity';
import MobileNavigationBar from './MobileNavigationBar';

interface Artist {
  name: string;
  imageUrl: string;
}

interface Activity {
  type: string;
  content: string;
  time: string;
}

const topArtists: Artist[] = [
  { name: 'Drake', imageUrl: 'https://cdn.builder.io/api/v1/image/assets/1749da0ea8b2432f926a2c3deb56fd0c/5f8ed255d9cb7d086314a3406402eee3dbd9ce19dfb211bcf4cbc39e225c7f37?apiKey=1749da0ea8b2432f926a2c3deb56fd0c&' },
  { name: 'Ado', imageUrl: 'https://cdn.builder.io/api/v1/image/assets/1749da0ea8b2432f926a2c3deb56fd0c/507719348bfebb0250ad27c5ee9380bb157a8f25725eecdfc97bbf57d8cee11c?apiKey=1749da0ea8b2432f926a2c3deb56fd0c&' },
  { name: 'Beatles', imageUrl: 'https://cdn.builder.io/api/v1/image/assets/1749da0ea8b2432f926a2c3deb56fd0c/6b036a7961c4f14aaf5e0db7ecff72f39b3febee4902a0f878a4ed92961d0da3?apiKey=1749da0ea8b2432f926a2c3deb56fd0c&' },
];

const recentActivities: Activity[] = [
  { type: '♡', content: 'Blinding Lights', time: '1 hr ago' },
  { type: '→', content: 'Taylor Swift', time: '1 day ago' },
  { type: '🎵', content: 'Bohemian Rhapsody', time: '30 min ago' },
];

const MobileProfile: React.FC = () => {
  return (
    <Container className="py-5">
      <Row className="mb-4">
        <Col xs={4}>
          <Image src="https://cdn.builder.io/api/v1/image/assets/1749da0ea8b2432f926a2c3deb56fd0c/5eb7f22987c02f80265245732f408d1d436123b072254206c7423d2c943cb14c?apiKey=1749da0ea8b2432f926a2c3deb56fd0c&" roundedCircle fluid />
        </Col>
        <Col xs={8}>
          <h2>John Doe</h2>
          <p className="text-muted">@john_doe</p>
          <p><strong>10</strong> Followers <strong>∞</strong> Following</p>
          <Button variant="secondary" size="sm">🖋️ Edit Profile</Button>
        </Col>
      </Row>

      <h3 className="mb-3">Top Artists This Month</h3>
      <Row className="mb-4">
        {topArtists.map((artist, index) => (
          <Col key={index} xs={4}>
            <MobileTopArtists name={artist.name} imageUrl={artist.imageUrl} />
          </Col>
        ))}
      </Row>
      <Button variant="secondary" className="w-100">Show all artists</Button>

      <h3 className="mt-4 mb-3">♬ Playlists</h3>
      <p className="text-center">Vibe Check 🎧</p>
      <p className="text-center">My Favorites</p>
      <Button variant="secondary" className="w-100">Show all playlists</Button>

      <h3 className="mt-4 mb-3">Recent Activity</h3>
      <Row className="bg-light py-2 mb-3">
        {recentActivities.map((activity, index) => (
          <Col key={index} xs={4}>
            <MobileProfileRecentActivity {...activity} />
          </Col>
        ))}
      </Row>
      <Button variant="secondary" className="w-100">Show all activity</Button>

      <hr className="my-4" />

      <MobileNavigationBar />
    </Container>
  );
};

export default MobileProfile;
